import React from "react";
import "./Search.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { options } from "../../Apis/Search";
import axios from "axios";

const Search = () => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);

  const handleSearch = async () => {
    try {
      const response = await axios.post(
        'https://travel-advisor.p.rapidapi.com/locations/v2/search',
        {
          query: query,
          updateToken: ''
        },
        {
          params: {
            currency: 'USD',
            units: 'km',
            lang: 'en_US'
          },
          headers: {
            'content-type': 'application/json',
            'X-RapidAPI-Key': '87827f1c84mshcc050ec80bd24e2p16bcdfjsnc548a5060814',
            'X-RapidAPI-Host': 'travel-advisor.p.rapidapi.com'
          }
        }
      );

      setResults(response.data);
    } catch (error) {
      console.error(error);
    }
  };
  
  const renderComponent = () => {
    return (
      <>
        <div>
      <input
        type="text"
        placeholder="Search..."
        value={query}
        onChange={(e) => setQuery(e.target.value)}
      />
      <button onClick={handleSearch}>Search</button>

      {results.length > 0 && (
        <ul>
          {results.map((result) => (
            <li key={result.location_id}>{result.location_name}</li>
          ))}
        </ul>
      )}
    </div>
      </>
    );
  };

  return renderComponent();
};

export default Search;
